import React from 'react';

function Footer() {
    return ( <
        footer >
        <
        p > & copy; 2023 Little Lemon.All rights reserved. < /p> <
        ul >
        <
        li > < a href = "/privacy" > Privacy Policy < /a></li >
        <
        li > < a href = "/terms" > Terms of Service < /a></li >
        <
        /ul> <
        /footer>
    );
}

export default Footer;
